import React from 'react'
import Obj from './component/Obj';

const MapMethod = (props) => {
    return (
        <>
            <ul> Student Data
                <li>Id : {props.id}</li>
                <li>Name : {props.name}</li>
                <li>Subject : {props.subject}</li>
            </ul>
        </>
    )
}
export default MapMethod;
